export function DotIcon({ fill, classes }) {
  return (
    <svg
      className={classes}
      width="6"
      height="7"
      viewBox="0 0 6 7"
      fill={fill || "none"}
      xmlns="http://www.w3.org/2000/svg"
    >
      <circle cx="3" cy="3.5" r="3" fill="#17B26A" />
    </svg>
  );
}
